import React, { useEffect } from 'react';

const ConsultationComponent = () => {
    useEffect(() => {
        // Load Calendly script
        const script = document.createElement('script');
        script.src = "https://assets.calendly.com/assets/external/widget.js";
        script.async = true;
        document.body.appendChild(script);

        return () => {
            // Cleanup: remove the script when the component unmounts
            document.body.removeChild(script);
        };
    }, []);

    return (
        <div className="max-w-4xl mx-auto p-40 flex flex-col items-center justify-center h-screen space-y-8">
            <h1 className="text-3xl font-bold">Book Your Consultation</h1>

            <div
                className="calendly-inline-widget"
                data-url="https://calendly.com/p218055-pwr/30min?text_color=000000&primary_color=000000"
                style={{ minWidth: '700px', height: '800px' }}
            ></div>
        </div>
    );
};

export default ConsultationComponent;
